import { withRouter } from 'next/router';

import Layout from '../components/Layout.js';

const SelectedCountry = withRouter(props => (
    <div>
        <h3>{props.router.query.name}</h3>
        <h3>{props.router.query.capital}</h3>
    </div>
));

export default () => (
    <Layout>
        <div>
            <SelectedCountry />
        </div>
    </Layout>
);

